import React from 'react'
import '../container/course.css';
import Leftdiv from './Leftdiv';
import Rightdiv from './Rightdiv';
import PythonContent from './PythonContent';
import { BrowserRouter as Router, Route ,Routes} from 'react-router-dom';
function Course() {
  return (
    <Router>
    <div className='main-file'>
      <Routes>
        <Route path="/python" element={<PythonContent />} /> {/* Use element prop for component rendering */}
        <Route path="/" element={<><Leftdiv /><Rightdiv /></>} /> {/* Use empty fragment to render multiple components */}
      </Routes>
    </div>
  </Router>
  )
}

export default Course
